import React, { useState, useEffect } from 'react';

import { Container } from './style';

import api from '../../services/api';

interface Iproduct{
    id: number;
    photo: string;
    description: string;
    price: number;
}
const Home: React.FC = () => {
    const [ data, setData ] = useState<Iproduct[]>([]);
    useEffect (() =>{
        api.get('').then(
            response => {
                setData(response.data)
            }
        )
    }, [])
    
    return(
      <Container>
         <section>
             {data.map( prod =>(
               
                <div className="product-content" key={prod.id}>
                    <img src="https://cdn.falauniversidades.com.br/wp-content/uploads/2020/04/02122231/ead-1.jpg" alt="cursos" width="200" height="auto"/>
                    <h4>Name</h4>
                    <span>descrição</span>
                    <h6>price</h6>
                </div>  
             ))}
          
         </section>
          </Container>
  );
}

export default Home;
